import React, { useState } from 'react';
import { View, Text, StyleSheet, TouchableOpacity } from 'react-native';

const LanguageSelection = () => {
  const [selectedOption, setSelectedOption] = useState('');

  const handleOptionSelect = (option) => {
    setSelectedOption(option);
  };

  return (
    <View style={styles.container}>
      <Text style={styles.title}>כדי לייעל את הפעילות שלנו, דרג את ההעדפות והמיומנויות שלך</Text>
      <Text style={styles.subtitle}>בחר אחת מהאפשרויות הבאות:</Text>
    
      <Text style={styles.subtitle}>כיצד אתה דובר אנגלית</Text>

      <TouchableOpacity
        style={[styles.option, selectedOption === 'שפת אם' && styles.selectedOption]}
        onPress={() => handleOptionSelect('שפת אם')}
      >
        <Text style={styles.optionText}>שפת אם</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={[styles.option, selectedOption === 'שפה נוספת' && styles.selectedOption]}
        onPress={() => handleOptionSelect('שפה נוספת')}
      >
        <Text style={styles.optionText}>שפה נוספת</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={[styles.option, selectedOption === 'רמה טובה' && styles.selectedOption]}
        onPress={() => handleOptionSelect('רמה טובה')}
      >
        <Text style={styles.optionText}>רמה טובה</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={[styles.option, selectedOption === 'רמה בינונית' && styles.selectedOption]}
        onPress={() => handleOptionSelect('רמה בינונית')}
      >
        <Text style={styles.optionText}>רמה בינונית</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={[styles.option, selectedOption === 'רמה בסיסית' && styles.selectedOption]}
        onPress={() => handleOptionSelect('רמה בסיסית')}
      >
        <Text style={styles.optionText}>רמה בסיסית</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={[styles.option, selectedOption === 'לא דובר' && styles.selectedOption]}
        onPress={() => handleOptionSelect('לא דובר')}
      >
        <Text style={styles.optionText}>לא דובר</Text>
      </TouchableOpacity>




      <Text style={styles.subtitle}>יש לך ידע בעזרה ראשונה</Text>
      <TouchableOpacity
  style={[styles.option, selectedOption === 'מע"ר' && styles.selectedOption]}
  onPress={() => handleOptionSelect('מע"ר')}
>
  <Text style={styles.optionText}>מע"ר</Text>
</TouchableOpacity>
<TouchableOpacity
  style={[styles.option, selectedOption === 'חובש' && styles.selectedOption]}
  onPress={() => handleOptionSelect('חובש')}
>
  <Text style={styles.optionText}>חובש</Text>
</TouchableOpacity>
<TouchableOpacity
  style={[styles.option, selectedOption === 'ידע בסיסי' && styles.selectedOption]}
  onPress={() => handleOptionSelect('ידע בסיסי')}
>
  <Text style={styles.optionText}>ידע בסיסי</Text>
</TouchableOpacity>


<TouchableOpacity
  style={[styles.option, selectedOption === ' ' && styles.selectedOption]}
  onPress={() => handleOptionSelect('רמה בינונית')}
>
  <Text style={styles.optionText}>רמה בינונית</Text>
</TouchableOpacity>
<TouchableOpacity
  style={[styles.option, selectedOption === 'רמה בסיסית' && styles.selectedOption]}
  onPress={() => handleOptionSelect('רמה בסיסית')}
>
  <Text style={styles.optionText}>רמה בסיסית</Text>
</TouchableOpacity>
<TouchableOpacity
  style={[styles.option, selectedOption === 'לא דובר' && styles.selectedOption]}
  onPress={() => handleOptionSelect('לא דובר')}
>
  <Text style={styles.optionText}>לא דובר</Text>
</TouchableOpacity>
    </View>
  );
};
const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: '#F5F5F5',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
    marginBottom: 20,
    textAlign: 'center',
    color: '#333',
  },
  subtitle: {
    fontSize: 16,
    marginBottom: 10,
    textAlign: 'center',
    color: '#666',
  },
  option: {
    borderWidth: 1,
    borderColor: '#CCC',
    borderRadius: 10,
    padding: 10,
    marginVertical: 5,
    width: 200,
    alignItems: 'center',
    justifyContent: 'center',
  },
  selectedOption: {
    backgroundColor: '#007AFF',
    borderColor: '#007AFF',
  },
  optionText: {
    fontSize: 16,
    color: '#333',
  },
});

export default LanguageSelection;
